.romper-player {
  font-family: 'Libre Baskerville', serif;
}
.romper-player > .romper-gui > .romper-buttons {
  /* display: none; */ /* hides all controls */
  background: none; /* gets rid of the gradient behind the controls */
  opacity: 1; /* buttons always visible (fullscreen button only) */
  z-index: 16; /* bring above choice icons */
}
.romper-fullscreen-button {
  pointer-events: all; /* fullscreen always clickable */
  filter: invert(100%);
}
.romper-player > .romper-gui > .romper-buttons > .romper-media-transport > div {
  border: none; /* removes white line that forms scrub bar background */
}
#scrub-bar {
  display: none !important; /* hides seek bar */
}
.romper-player > .romper-gui > .romper-buttons {
  bottom: 2%;
}
.romper-buttons .center {
  display: none; /* hides transport buttons */
}
.romper-player > .romper-gui > .romper-buttons .left {
  display: none; /* hides volume button */
}
.romper-player > .romper-gui > .romper-buttons > .romper-media-transport {
  width: 96%; /* moves fullscreen closer to corner */
}
.romper-player > .romper-gui > .romper-buttons.icons-showing {
  background: none; /* prevent black flash as transport bar makes way for choice icons */
}
.romper-player > .romper-gui .romper-button {
  background-color: rgba(0,0,0,0.5); /* gives fullscreen background colour */
}
.romper-player .romper-link-choice-overlay {
    background: none;
    padding: 3% 10% 1% 10%; /* shrinks choices */
}

.romper-player .romper-link-choice-overlay .romper-control-selected.text {
    border-bottom: 2px solid black; /* gives text choices a red underline when selected */
}
.romper-text-link-container {
  /* height: 4em; /* shrinks choices */
  /* transform: translate(0, 1em); */
}
.romper-link-text-icon {
  color: #000;
  margin-top: 50px;
  margin-bottom: 0;
}
.romper-player .romper-media.romper-prestart .romper-privacy-notice {
  background: none;
  bottom: 6%;
  color: #8C8C8C;
}
.romper-player > .romper-media {
  background-color: white; /* page background to white so fullscreen icons show */
}
.romper-player > .romper-loading > .romper-render-image {
  background-color: transparent; /* allow page background to show through */
}
.romper-player > .romper-media > .romper-loading {
  background-color: transparent; /* allow page background to show through */
}


